(21, 21, 1, 0, 0, '', 2, 5, 1, 'Продам немного дсп', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce pulvinar  risus at eleifend venenatis. Nunc vitae diam eu urna mollis dapibus sit  amet quis nisl. Nam tempor aliquet aliquet. Vestibulum a laoreet lectus.  Nunc nec lacus scelerisque ligula interdum maximus at non enim. Donec  laoreet mattis nulla id mollis. Curabitur vulputate metus quis blandit  vestibulum. Proin efficitur augue ut ante imperdiet, ut semper ipsum  egestas. Mauris nec augue ullamcorper, imperdiet odio id, maximus lacus.  Nunc venenatis viverra elit quis consectetur. Proin facilisis bibendum  mauris, sed finibus nisl eleifend in.</p>\r\n<p>Aenean mollis tincidunt lectus, sit amet pretium purus facilisis id.  Vivamus vitae dapibus magna. Proin euismod in libero eget condimentum.  Donec at scelerisque lorem. Sed ac rutrum dui. Aenean non lobortis ex.  Fusce sit amet dolor nisl.</p>', '', 9999, '2015-05-14 23:53:08', '0000-00-00 00:00:00', '', '', '', '', 2, 0, ''),
