(1, 0, 10, 1, 0, 'Источник: три боевых подразделения переброшены на восток Украины', '2014-04-08 00:00:00', 'По словам источника в украинских правоохранительных органах, речь идет о бойцах внутренних войск. Митинги сторонников федерализации прошли в Донецке, Харькове и Луганске, их участники требуют провести референдумы о статусе своих регионов.', '<p><strong>КИЕВ, 7 апр&nbsp;&mdash; РИА Новости.</strong> Три боевых подразделения переброшены в&nbsp;Донецкую и&nbsp;Луганскую области на&nbsp;востоке Украины для&nbsp;подавления народных восстаний, сообщил в&nbsp;понедельник источник в&nbsp;украинских правоохранительных органах.</p>\r\n\r\n<p>По словам источника, речь идет о &quot;подразделении внутренних войск&quot;, &quot;второе&nbsp;&mdash; подразделении нацгвардии, состоящих из&nbsp;отборных бойцов &quot;Правого сектора&quot;.</p>\r\n\r\n<p>&quot;Третье&nbsp;&mdash; наемники Blackwater в&nbsp;форме отряда спецназначения МВД Украины &quot;Сокол&quot;. Их задача&nbsp;&mdash; максимально быстро и&nbsp;жестко разобраться с&nbsp;протестующими&quot;,&nbsp;&mdash; сказал источник.</p>\r\n\r\n<div class="inject-wrapper" id="inject_1002804692">\r\n<div class="big-inject">\r\n<div class="inject_photo_illustration">&nbsp;\r\n<div class="media_copyright"><a href="http://ria.ru/docs/about/copyright_reuters.html">&copy; REUTERS/ Stringer</a></div>\r\n</div>\r\n\r\n<div class="inject_type1_announce"><a href="http://ria.ru/photolents/20140407/1002808195_1002796035.html" target="_blank">Акции сторонников федерализации на востоке Украины. Фотолента</a></div>\r\n</div>\r\n</div>\r\n\r\n<p>Политический кризис разразился на&nbsp;Украине в&nbsp;конце ноября 2013 года, когда кабинет министров объявил о&nbsp;приостановке евроинтеграции страны. Массовые протесты, названные &quot;евромайданом&quot;, прошли по&nbsp;всей Украине и&nbsp;в январе вылились в&nbsp;столкновения <a href="http://ria.ru/photolents/20140219/995720812_995715054.html">вооруженных радикалов</a> с&nbsp;органами правопорядка. Результатом уличных схваток, в&nbsp;ходе которых оппозиция неоднократно применяла огнестрельное оружие и <a href="http://ria.ru/photolents/20140218/995594647_995590360.html">&quot;коктейли Молотова&quot;</a>, стали десятки человеческих жертв.</p>\r\n\r\n<p>22 февраля в&nbsp;стране произошел насильственный захват власти. Верховная рада, нарушив <a href="http://ria.ru/world/20140221/996319889.html">достигнутые договоренности</a> между президентом Виктором Януковичем и&nbsp;лидерами оппозиции, изменила конституцию, сменила руководство парламента и&nbsp;МВД и&nbsp;отстранила от&nbsp;власти главу государства, который впоследствии был вынужден покинуть Украину, опасаясь за&nbsp;свою жизнь. 27 февраля украинский парламент утвердил состав так называемого &quot;правительства народного доверия&quot;, премьером стал Арсений Яценюк.</p>\r\n\r\n<p>Ряд областей востока и&nbsp;юга Украины не&nbsp;признали легитимности Рады и&nbsp;приняли решение о&nbsp;возможности проведения референдумов о&nbsp;дальнейшей судьбе регионов.</p>\r\n\r\n<div class="article_inject_article-article" id="inject_1002914794">\r\n<div class="inject_type2 inject_right">\r\n<div class="inject_photo_illustration"><a href="http://ria.ru/world/20140407/1002914794.html" target="_blank"><img alt="Активист с российским флагом у здания областной администрации в Донецке" src="http://cdn1.img22.ria.ru/images/100287/51/1002875137.jpg" title="Активист с российским флагом у здания областной администрации в Донецке" /></a>\r\n\r\n<div class="media_copyright">&copy; East News</div>\r\n</div>\r\n\r\n<div class="inject_type2_title"><a href="http://ria.ru/world/20140407/1002914794.html" target="_blank">Киев направит на восток эмиссаров, закон о сепаратизме могут усилить</a></div>\r\n</div>\r\n</div>\r\n\r\n<p>С марта акции протеста проходят на&nbsp;востоке Украины каждые выходные, их участники не&nbsp;признают легитимности назначенных Киевом новых губернаторов и&nbsp;требуют федерализации страны. В Донецкой области Украины митингующие, взявшие под&nbsp;контроль здание Донецкой областной госадминистраци и&nbsp;облсовета, создали Народный совет&nbsp;&mdash; в&nbsp;связи с&nbsp;тем, что депутаты облсовета отказались собирать внеочередную сессию и&nbsp;принимать решение о&nbsp;проведении референдума о&nbsp;статусе области. Участники Народного совета приняли акт о&nbsp;провозглашении Донецкой народной республики и&nbsp;проведении референдума о&nbsp;присоединении к&nbsp;России не&nbsp;позднее 11 мая. В Харькове митингующие также взяли в&nbsp;воскресенье под&nbsp;свой контроль здание госадминистрации, в&nbsp;Луганске&nbsp;&mdash; региональное управление Службы безопасности. Основное требование митингующих&nbsp;&mdash; федерализация Украины и&nbsp;проведение референдума о&nbsp;присоединении восточных регионов к&nbsp;РФ.</p>\r\n\r\n<p>Назначенный Радой исполняющим обязанности главы Украины Александр Турчинов в&nbsp;понедельник не&nbsp;исключил применения, в&nbsp;том числе, силовых мер. Турчинов сообщил, что из-за пассивного поведения некоторых местных правоохранительных структур они будут доукомплектованы за&nbsp;счет подразделений из&nbsp;других регионов. Он напомнил, что для&nbsp;координации деятельности силовых структур власть направила в&nbsp;Харьков министра внутренних дел Арсена Авакова, в&nbsp;Донецк&nbsp;&mdash; первого вице-премьера Виталия Ярёму, в&nbsp;Луганск&nbsp;&mdash; секретаря СНБО Андрея Парубия и&nbsp;главу СБУ Валентина Наливайченко.</p>\r\n\r\n<p>Между тем в&nbsp;Киеве было объявлено о&nbsp;выполнении плана по&nbsp;мобилизации в&nbsp;вооруженные силы и&nbsp;национальную гвардию Украины. Также в&nbsp;понедельник в&nbsp;Верховной раде был зарегистрирован законопроект депутата Николая Рудьковского о&nbsp;введении чрезвычайного положение в&nbsp;Луганской, Донецкой и&nbsp;Харьковской областях.</p>\r\n\r\n<div style="overflow: hidden; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); text-align: left; text-decoration: none; border: medium none;"><br />\r\nРИА Новости <a href="http://ria.ru/world/20140407/1002917878.html#ixzz2yHj1Wv9c" style="color: #003399;">http://ria.ru/world/20140407/1002917878.html#ixzz2yHj1Wv9c</a></div>', 'news/792_5783ab083b2f5.jpg', 'Политика', 0, ''),
(2, 0, 20, 1, 0, 'Партия регионов хочет направить на восток Украины переговорную группу', '2014-04-08 00:00:00', 'Фракция Партии регионов в Верховной раде Украины потребовала немедленно отправить в регионы, где отмечен рост напряженности, группу переговорщиков, в состав которой должны войти представители правительства и представители депутатских фракций.', '<p><strong>КИЕВ, 8 апр&nbsp;&mdash; РИА Новости.</strong> Фракция ушедшей  в&nbsp;оппозицию Партии регионов требует создать парламентскую переговорную  группу по&nbsp;урегулированию ситуации на&nbsp;востоке Украины, где проходят  митинги сторонников федерализации, заявил во&nbsp;вторник народный депутат  партии Владислав Лукьянов.</p>\r\n<p>&quot;Мы требуем создать группу переговорщиков, в&nbsp;состав которой должны  войти представители правительства, представители депутатских фракций,  которая немедленно отправится в&nbsp;те регионы, где существует  напряжение&quot;,&nbsp;&mdash; сказал Лукьянов, выступая на&nbsp;заседании Верховной рады. По  его мнению, ситуация на&nbsp;востоке страны должна быть урегулирована  исключительно мирным путем.</p>\r\n<div class="article_inject_article-article" id="inject_1002909830">\r\n<div class="inject_type2 inject_right">\r\n<div class="inject_photo_illustration"><a target="_blank" href="http://ria.ru/world/20140407/1002909830.html"><img itemprop="associatedMedia" title="Олег Царев, архивное фото" alt="Олег Царев, архивное фото" src="http://cdn4.img22.ria.ru/images/100146/07/1001460730.jpg" /></a>\r\n<div class="media_copyright">&copy; Фото:  Rowland Goodman</div>\r\n</div>\r\n<div class="inject_type2_title"><a target="_blank" href="http://ria.ru/world/20140407/1002909830.html">Депутат Рады: основная проблема Киева - в отсутствии диалога с народом</a></div>\r\n</div>\r\n</div>\r\n<p>Митинги сторонников федерализации проходят в&nbsp;последние дня на&nbsp;востоке  Украины&nbsp;&mdash; в&nbsp;Донецке, Харькове и&nbsp;Луганске, их участники требуют провести  референдумы о&nbsp;статусе своих регионов. С марта акции протеста проходят  на&nbsp;востоке Украины каждые выходные, их участники не&nbsp;признают  легитимность новых губернаторов, назначенных после отстранения от&nbsp;власти  президента Виктора Януковича.</p>\r\n<p>В понедельник в&nbsp;Донецке протестующие создали &quot;народный совет&quot;,  который провозгласил создание Донецкой народной республики, объявил  о&nbsp;намерении провести не&nbsp;позднее 11 мая референдум о&nbsp;присоединении  к&nbsp;России и&nbsp;обратился к&nbsp;Москве с&nbsp;просьбой ввести миротворческий  контингент. В Харькове захватившие областную администрацию активисты  объявили о&nbsp;создании Харьковской народной республики.</p>\r\n<h3>Как на&nbsp;Украине сменилась власть</h3>\r\n<p>Политический кризис разразился на&nbsp;Украине в&nbsp;конце ноября 2013 года,  когда кабинет министров объявил о&nbsp;приостановке евроинтеграции страны.  Массовые протесты, названные &quot;евромайданом&quot;, прошли по&nbsp;всей Украине и&nbsp;в  январе вылились в&nbsp;столкновения <a href="http://ria.ru/photolents/20140219/995720812_995715054.html">вооруженных радикалов</a> с&nbsp;органами правопорядка. Результатом уличных схваток, в&nbsp;ходе которых оппозиция неоднократно применяла огнестрельное оружие и <a href="http://ria.ru/photolents/20140218/995594647_995590360.html">&quot;коктейли Молотова&quot;</a>, стали десятки человеческих жертв.</p>\r\n<p>22 февраля в&nbsp;стране произошел насильственный захват власти. Верховная рада, нарушив <a href="http://ria.ru/world/20140221/996319889.html">достигнутые договоренности</a>  между президентом Виктором Януковичем и&nbsp;лидерами оппозиции, изменила  конституцию, сменила руководство парламента и&nbsp;МВД и&nbsp;отстранила от&nbsp;власти  главу государства, который впоследствии был вынужден покинуть Украину,  опасаясь за&nbsp;свою жизнь. 27 февраля украинский парламент утвердил состав  так называемого &quot;правительства народного доверия&quot;, премьером стал  Арсений Яценюк.</p>\r\n<p>&nbsp;</p>', 'news/053_5343c03d6a4b8.jpg', 'Политика', 0, ''),
(3, 0, 30, 1, 0, 'Производство РЗЭ планируется запустить в Красноярском крае в 2017 г', '2014-04-08 00:00:00', 'Ожидается, что новый завод позволит обеспечить потребность в редкоземельных элементах (РЗЭ) предприятий военно-промышленного комплекса, авиационной, космической и электронной промышленности РФ.', '<p><strong>МОСКВА, 20 мар&nbsp;&mdash; РИА Новости.</strong> Завод по&nbsp;выпуску  редкоземельных элементов и&nbsp;производство &quot;атомных&quot; электрических батарей  планируется запустить в&nbsp;Железногорске (Красноярский край) в&nbsp;рамках  четырех проектов ФГУП &quot;Горно-химический комбинат&quot; (ГХК, входит  в&nbsp;госкорпорацию &quot;Росатом&quot;), направленных на&nbsp;развитие железногорского  инновационного кластера, сообщает отдел по&nbsp;связям с&nbsp;общественностью ГХК.</p>\r\n<p>Ожидается, что новый завод позволит обеспечить потребность  в&nbsp;редкоземельных элементах (РЗЭ) предприятий военно-промышленного  комплекса, авиационной, космической и&nbsp;электронной промышленности РФ. ГХК  совместно с&nbsp;Сибирским отделением Российской академии наук разрабатывает  высокоэффективную технологию получения РЗЭ, ориентированную на&nbsp;руды  Томторского месторождения (Якутия). Инвестиционная емкость проекта  составляет около&nbsp;9 миллиардов рублей, планируемое количество  высококвалифицированного персонала&nbsp;&mdash; более 300 человек, отмечается  в&nbsp;сообщении.</p>\r\n<p>Другой проект, планируемый к&nbsp;реализации в&nbsp;Железногорске,&nbsp;&mdash;  производство радиоактивных изотопов на&nbsp;базе центра инженерных  компетенций опытно-демонстрационного центра (ОДЦ) ГХК. Оно должно  обеспечить максимальную диверсификацию переработки отработавшего  ядерного топлива на&nbsp;ОДЦ и&nbsp;переведет значительную часть радиоактивных  отходов в&nbsp;товарную радиоизотопную продукцию для&nbsp;медицины, авиации  и&nbsp;космонавтики, нефтяной и&nbsp;химической промышленности.</p>\r\n<p>Этот завод будет производить в&nbsp;товарной фасовке радиоизотопы цезия,  стронция, ксенона, криптона, трития, америция, кюрия, нептуния  и&nbsp;технеция общим объемом более трех с&nbsp;половиной тонн и&nbsp;стоимостью  реализации 4,8 миллиардов рублей в&nbsp;год. На заводе предполагается  создание более 120 рабочих мест для&nbsp;высококвалифицированных  радиохимиков. Планируемый объем инвестиций&nbsp;&mdash; 930 миллионов рублей, срок  окупаемости&nbsp;&mdash; 6 лет.</p>\r\n<p>Третий проект связан с&nbsp;выпуском дозиметрических приборов и&nbsp;систем  контроля радиационной обстановки. Он задуман как&nbsp;компактное  высокотехнологическое производство для&nbsp;малого и&nbsp;среднего бизнеса  с&nbsp;количеством персонала около&nbsp;40 человек. Планируется производство  дверных рамок-детекторов, железнодорожных мониторов контроля  радиоактивности в&nbsp;вагонах, гамма-сигнализаторов и&nbsp;датчиков  бета-излучения. Планируемый объем реализации&nbsp;&mdash; около&nbsp;460 миллионов  рублей в&nbsp;год, требуемые инвестиции&nbsp;&mdash; 260 миллионов рублей.</p>\r\n<p>Наконец, четвертый проект&nbsp;&mdash; это производство &quot;атомных&quot; электрических  батарей, использующих энергию &quot;мягкого&quot; бета-распада радиоизотопа  никель-63 со&nbsp;сроком службы более 50 лет. Это наиболее сложный  и&nbsp;высокотехнологический проект, который делится на&nbsp;два сегмента&nbsp;&mdash;  наработка изотопа Ni63 и&nbsp;фабрикация &quot;атомных батареек&quot;, отмечается  в&nbsp;сообщении. Реализация данного проекта позволит создать новое поколение  автономной радиоэлектроники и&nbsp;медицинской техники. Пуск  опытно-промышленного производства запланирован на&nbsp;2018 год.</p>\r\n<div style="overflow: hidden; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); text-align: left; text-decoration: none; border: medium none;"><br />\r\nРИА Новости <a href="http://ria.ru/nano_news/20140320/1000351278.html#ixzz2yHnaDfep" style="color: #003399;">http://ria.ru/nano_news/20140320/1000351278.html#ixzz2yHnaDfep</a></div>', 'news/867_5343c36b06d87.jpg', 'Телевиденье', 0, ''),
