(24, 9, 20, 1, 0, 'Текст О НАС на главной', '<p>Найти строительные материалы это всегда проблема. Поиск строительных материалов занимает уйму времени. Иногда товара нет в наличии, иногда цены не актуальные, а порой просто просто тяжело сделать выбор строительных материалов.</p>\r\n\r\n<p>Наш сайт &quot;<a href="/">OSTATKI.KZ</a>&quot; поможет вам найти строительные материалы методом размещения открытых тендеров на любые товары и все строительные материалы.</p>', '', '');
