(404, 24, 100000, 1, 0, 'Levante Gaudi 50 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Колготки с Лайкрой и микрофиброй. Без шортиков. плоский шов, ластовица из хлопка, прозрачный мысок.</span></p>', 1050, 'GAUDI 50', 'Levante', 'Полиамид: 86% \r\nЭластан: 11% \r\nХлопок: 3%\r\n', '50 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(405, 24, 100000, 1, 0, 'Levante Matisse 15 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Колготки из микрофибры со специальной пряжей Тактэл и Лайкрой. Без шортиков, плоский шов и ластовица из хлопка.</span></p>', 1500, 'MATISSE 15', 'Levante', 'Полиамид: 63%\r\nЭластан: 35% \r\nХлопок: 2%\r\n', '15 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(406, 24, 100000, 1, 0, 'Levante Matisse Airskin 30 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Изящные колготки, с применением новейшей патентованной технологии &quot;двойной поверхности&quot;, позволяющей ногам &quot;дышать естественно&quot;. Удивительно бархатистые, мягкие и матовые, благодаря трехмерной микрофибре 3D. Без шортиков, плоский шов и ластовица из хлопка.</span></p>', 1500, 'MATISSE AIRSKIN 30 ', 'Levante', 'Полиамид: 76%\r\nЭластан: 21% \r\nХлопок: 3%\r\n', '30 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(407, 24, 100000, 1, 0, 'Levante Matisse Airskin 50 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Изящные колготки, с применением новейшей патентованной технологии &quot;двойной поверхности&quot;, позволяющей ногам &quot;дышать естественно&quot;. Удивительно бархатистые, мягкие и матовые, благодаря трехмерной микрофибре 3D. Без шортиков, плоский шов и ластовица из хлопка.</span></p>', 1650, 'MATISSE AIRSKIN 50 ', 'Levante', 'Полиамид: 83%\r\nЭластан: 14% \r\nХлопок: 3%\r\n', '50 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(408, 25, 100000, 1, 0, 'Levante Star V.B. 15 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Шелковистые, матовые и прозрачные колготки с Лайкрой.</span></p>', 1100, 'STAR 15 V.B.', 'Levante', 'Полиамид: 80%\r\nЭластан: 17%\r\nХлопок: 3%\r\n', '15 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(409, 25, 100000, 1, 0, 'Levante Hola Vita Bassa 20 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Шелковистые, матовые колготки. Революционные и очень удобные утягивающие трусики-бикини. Плоский шов, ластовица из хлопка.</span></p>', 1250, 'HOLA 20 Vita Bassa', 'Levante', 'Полиамид: 82%\r\nЭластан: 15%\r\nХлопок: 3%\r\n', '20 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(410, 25, 100000, 1, 0, 'Levante Bikini 20 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Шелковистые, матовые колготки с Лайкрой. Трусики-бикини с цветочным рисунком по кромке. Плоский шов и ластовица из хлопка.</span></p>', 1150, 'BIKINI 20', 'Levante', 'Полиамид: 80%\r\nЭластан: 17%\r\nХлопок: 3%\r\n', '20 DEN', 'Полиамид: 80%\r\nЭластан: 17%\r\nХлопок: 3%\r\n', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(411, 3, 100000, 1, 0, 'Levante Romantic 15 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Шелковистые, тонкие, самоподдерживающиеся чулки с Лайкрой двойной обкрутки и эластичной кружевной резинкой на силиконовой основе.</span></p>', 1500, 'ROMANTIC 15', 'Levante', 'Полиамид: 81%\r\nЭластан: 19%\r\n', '15 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(412, 3, 100000, 1, 0, 'Levante Romantic 20 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Шелковистые, тонкие, самоподдерживающиеся чулки с Лайкрой двойной обкрутки. Очень лёгкая кружевная резинка, позволяющая ногам &quot;дышать естественно&quot;.&nbsp; Невидимый носок.</span></p>', 1500, 'ROMANTIC 20', 'Levante', 'Полиамид: 81% \r\nЭластан: 19%\r\n', '20 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(413, 3, 100000, 1, 0, 'Levante Romantic 30 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Шелковистые, тонкие, самоподдерживающиеся чулки с кружевной эластичной резинкой на силиконовой основе.</span></p>', 1550, 'ROMANTIC 30', 'Levante', 'Полиамид: 84% \r\nЭластан: 16%\r\n', '30 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(414, 3, 100000, 1, 0, 'Levante Romantic 50 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Шелковистые, тонкие, самоподдерживающиеся чулки из микрофибры и Лайкры с эластичной резинкой на силиконе.</span></p>', 1850, 'ROMANTIC 50', 'Levante', 'Полиамид: 89% \r\nЭластан: 11%\r\n', '50 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
