(5, 5, 100000, 1, 0, 'Колготки Filodoro OK Shape 40 ', '<p><span itemprop="description">Матовые шелковистые колготки с лайкрой  двойной обкрутки, плотностью 40 ден, полупрозрачные. С плоским швом и  поддерживающими трусиками-слип, моделирующими фигуру, х/б ластовица,  укрепленный мысок, формованные.</span></p>', 5600, 'артикул 88', 'Filodoro ', '79% Полиамид\r\n18% Эластан\r\n3% Хлопок', '40 ден ', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929 ', '3\r\n5\r\nXL\r\n3/4\r\nunico\r\n5XXL', 1, 0, 10, 0, '', ''),
