(405, 24, 100000, 1, 0, 'Levante Matisse 15 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Колготки из микрофибры со специальной пряжей Тактэл и Лайкрой. Без шортиков, плоский шов и ластовица из хлопка.</span></p>', 1500, 'MATISSE 15', 'Levante', 'Полиамид: 63%\r\nЭластан: 35% \r\nХлопок: 2%\r\n', '15 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
(406, 24, 100000, 1, 0, 'Levante Matisse Airskin 30 DEN', '<p><span style="font-size:8.5pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-ansi-language:RU;mso-fareast-language:\r\nRU;mso-bidi-language:AR-SA">Изящные колготки, с применением новейшей патентованной технологии &quot;двойной поверхности&quot;, позволяющей ногам &quot;дышать естественно&quot;. Удивительно бархатистые, мягкие и матовые, благодаря трехмерной микрофибре 3D. Без шортиков, плоский шов и ластовица из хлопка.</span></p>', 1500, 'MATISSE AIRSKIN 30 ', 'Levante', 'Полиамид: 76%\r\nЭластан: 21% \r\nХлопок: 3%\r\n', '30 DEN', 'Чёрный|#000\r\nСерый|#696969\r\nБордовый|#8C2929', 'S\r\nM\r\nL', 1, 0, 0, 0, '', ''),
